import HandleClick from "./HandleClick"

export function getProducts() {
    fetch("https://localhost:44317/api/EladoTermek")
        .then((response) => {
            return response.json()
        })
        .then(data => {
            var main=document.getElementById("termekek")
            var card
            data.forEach((adat) => {
                if (adat.Aktiv) {
                    card=(<div className="termek" onClick={() => { HandleClick(adat.Id) }}>
                        <div><img src={adat.Kep[0].EleresiUt} /></div>
                        <div><span id='termekname'>{adat.Konyv.Cim}</span></div>
                        <div><span id='termekprice'>{adat.Ar} Ft</span><span id='termekdistance' >{adat.Ar} km</span></div>
                    </div>)}})
            console.log(card)
            var termek=document.createElement("div")
            termek.classList.add("termek")
            termek.addEventListener('click',HandleClick(adat.Id))

            
        })
        .catch((error) => {
            console.error("Hiba történt:", error);
        })
}
